CREATE FUNCTION fixdupes() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
   d RECORD;
BEGIN
   FOR d IN SELECT * FROM experiment5 group by entry, gui, value
            having count(*) > 1 limit 1
      LOOP
         DELETE FROM experiment5 WHERE entry=d.entry and gui=d.gui and value=d.value;

      END LOOP;
   RETURN;
END;
$$;


